import React, { Component } from 'react';
import './HomePage.css';
import NavPrices from '../components/prices/NavPrices';
import NavBar from '../components/navbar/NavBar';

class Tarifs extends Component {
    render() {
        return (
            <div>
            <div className="container">
            <NavPrices />
            </div>
            </div>
        );
    }
}

export default Tarifs
